import React from "react";
import "./assets/css/base/base.css";
import { BrowserRouter as Router } from "react-router-dom/cjs/react-router-dom.min"; // Chama BrowserRouter de Router
import Home from "./paginas/Home";
import Sobre from "./paginas/Sobre";

function App() {
  return (
    <>
      <Router>
        <Home />
        <Sobre />
      </Router>
    </>
  );
}

export default App;
